import { StyleSheet} from "react-native";
const styles = StyleSheet.create({
    shadow: {
      shadowColor: "#7F5Df0",
      shadowOffset: {
        width: 0,
        height: 10,
      },
      shadowOpacity: 0.25,
      shadowRadius: 3.5,
      elevation: 5,
    },
  });
